import React from 'react'
import './Home.css'

const Home=(props)=>{
    return(
        <div>
        <h1 >this is Home of {props.nameOfUser}</h1>
        <h1 id="id1">this is Home</h1>
        <h1 className="class1">this is Home</h1>
        </div>
    );
}




export default Home;
